import axios from "axios";
import { useEffect, useState } from "react";

const [data, setData] = useState([]);
const [entryId, setEntryId] = useState(1);
const [name, setName] = useState(1);
const [createdAt, setCreatedAt] = useState(1);
const [updatedAt, setUpdatedAt] = useState(1);

function ListAllEntries() {
  useEffect(async () => {
    axios.get("http://localhost:9001/entries/all").then((res) => {
      setData(data);
      setEntryId(entryId);
      setName(name);
      setCreatedAt(createdAt);
      setUpdatedAt(updatedAt);
    });
  });

  return (
    <div>
      <table className="table table-striped">
        <thead>
          <tr>
            <th scope="col">Entry ID</th>
            <th scope="col">Name</th>
            <th scope="col">Created At</th>
            <th scope="col">Updated At</th>
          </tr>
        </thead>
        <tbody>
          {data.map((entry) => (
            <tr>
              <th scope="row">{entry.entryId}</th>
              <td>{entry.name}</td>
              <td>{entry.createdAt}</td>
              <td>{entry.updatedAt}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ListAllEntries;
